import { useState } from "react";

const Example = () => {
  const [ischecked, checkToggle] = useState(true);
  return (
    <>
      <input
        type="checkbox"
        checked={ischecked}
        onchange={(e) => checkToggle(e)}
      />
    </>
  );
};

export default Example;
